      <Box sx={{ display: "flex", width: "100% " }}>
        <Drawer />
        <Box component="main">
          <div style={{ marginTop: 60, marginLeft: 5 }}>
            <Editor onInit={(evt, editor) => (editorRef.currnt = editor)} />
